  false,\n\t\"url\": null,\n\t\"notes\": \"The data in this accession was collected
  using eleven different ships used to conduct 26 different cruises between April
  1, 1989 and April 30, 1990. The real time data of water temperature at varying depth
  bathythermograph (XBT) was recorded in stripcharts by the US Navy. One box of these
  analog data were submitted by Mr. Paul Stevens of Fleet Numerical Oceanography Center,
  Monterey CA to NODC. The XBT data from these stripcharts have been digitized and
  is present in the current NODC data storage system in C116 file format.\",\n\t\"owner_org\":
